import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'
import Form from './components/Form/Form'
import Main from './components/Main/Main'


class App extends React.Component {

  constructor(props){
    super(props);
    this.state = {};
  }

  render () {

    return (
      <div className="App">
        <Form />
        <Main />
      </div>
    );
  }
}

export default App;
